import logo from "./logo.svg";
import "./App.css";
import Home from "./Components/Home/Home.jsx";
import Dump from "./Components/dump";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function App() {
  return (
    <Router>
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/QuestionChoice">
        <QuestionChoice />
      </Route>
    </Switch>
  </Router>
  );
}

export default App;
